script: |
  super -f text -I q5707.spq | sort > q5707.out

inputs:
  - name: q5707.spq
    data: |
      SELECT DISTINCT col1 + + col0, col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN - - 60 * + + col0 + col2 + - col2 AND - col1;
  - name: tab0

outputs:
  - name: q5707.out
    data: |
